css:
@-moz-document domain(www.picuki.com), domain(gramhir.com) {
  body {
    background: #24282D;
    color: #AAA;
  }
  .main-header.header-search, .news_popup_header, .main-trending__hashtag-block-wrapper {
    background: #1A1E24;
  }
  .logo a, .dropdown_menu .a_li a {
    color: #FFF;
  }
  .profile-name-top, .profile-description, .result-username {
    color: #CCC;
  }
  .main-trending__profile-block-wrapper, .box-photo, .single-photo-info .white-box, .info-bottom, .page-desc-wrapper, .news_popup_body, .search-body-wrapper {
    background: #31373C;
  }
  .photo-description, .single-photo-info .white-box, .info-bottom {
    color: #AAA;
  }
}
